import styled from 'styled-components';
import AppHeader from './AppHeader';

const Header = styled.div `
    background:rgb(0, 0, 0);
    text-align: center;
    padding: 1rem 2rem;
    color: rgb(71, 205, 74);
    font-size: 1rem;
    text-align: left;
    border: 1px;
`;


const App = () => (
    <div>
        <AppHeader />
        {/* Otros componentes */}
    </div>
);

export default Header;
